import React, { Component } from "react";

class Biografia extends Component {
  render() {
    return (
      <div className="Biografia">
        <div className="left">&nbsp;</div>
        <div className="right">
          <h1>Ricardo Luís Oliveira</h1>
          <p>
            Nascido a 10 de Setembro de 1996 no Porto, viveu e cresceu com a sua família na cidade de Ovar, em Aveiro. Desde tenra idade já mostrava interesse pelas artes performativas e musicais, pelo que aos cinco anos de idade começou a aprender piano e a frequentar aulas de formação musical. Pouco tempo mais tarde iniciou a sua formação em dança contemporânea na Escola de Bailado do Orfeão de Ovar, tendo participado em inúmeros espetáculos ao longo da sua vida com esta escola.
          </p>
          <p>
            Apesar da sua preferência de estudos ter sempre pertencido às disciplinas artísticas, frequentou e concluiu o ensino secundário no curso de Ciências e Tecnologias e, em 2018, licenciou-se em Ciências do Meio Aquático pela Universidade do Porto. Durante este tempo centrado na área científica continuou a desenvolver a sua formação em dança e participou em vários workshops e espetáculos da mesma área.
          </p>
          <p>
            No presente ano, apresenta o primeiro espetáculo da sua autoria, como projeto final da sua Pós-graduação em Dança Contemporânea da Escola Superior de Música e Artes do Espetáculo.
          </p>
        </div>
      </div>
    );
  }
}

export default Biografia;
